import React from "react";
import './Socials.css';

const Socials = () => (
  <div  className="socials">
    <i className="fab fa-facebook-f"></i>
    <i className="fab fa-twitter"></i>
    <i className="fab fa-linkedin-in"></i>
    <i className="fab fa-behance"></i>
  </div>
);


export default Socials;
